'use strict';

exports.createActivity = function(args, res, next) {
  /**
   * Create activity
   * Create an activity. A description must be provided
   *
   * projectId String 
   * body ActivityDTO  (optional)
   * returns ActivityDTO
   **/
  var examples = {};
  examples['application/json'] = {
  "name" : "aeiou",
  "description" : "aeiou",
  "id" : 123456789,
  "projectId" : "aeiou"
};
  if (Object.keys(examples).length > 0) {
    res.setHeader('Content-Type', 'application/json');
    res.end(JSON.stringify(examples[Object.keys(examples)[0]] || {}, null, 2));
  } else {
    res.end();
  }
}

